nd":{"row":304,"column":24}},"text":"v"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":304,"column":24},"end":{"row":304,"column":25}},"text":"a"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":304,"column":25},"end":{"row":304,"column":26}},"text":"c"}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row":304,"column":26},"end":{"row":304,"column":27}},"text":"y"}]}],[{"group":"doc","deltas":[{"action":"removeLines","range":{"start":{"row":311,"column":0},"end":{"row":318,"column":0}},"nl":"\n","lines":["<p>iChanger is developed and maintained by a 3 Developer Group named TheLocken, Bradley (Rosco1502), Loren (Theredspy1155), and Jase (Aries).</p>","<p><ul><li>Bradley is the lead developer, he coded almost all of iChanger and also started TheLocken LLC, and iChanger</li><li>Loren is the main Android and Java coder of iChanger.</li><li>Jase is the main Icon-Gatherer, he sends icons he finds on various sources to our team to implement into iChanger.</li></ul></p>","<p>We get icons form various sources, including (but not limited to) <a href=\"http://deviantart.com/\" class=\"external close-popup\">DiviantArt.com</a>, <a href=\"http://uiconstock.com/\" class=\"external close-popup\">UIconStock</a>, etc.</p>","<p>Extra thanks to <a href=\"http://ffra.deviantart.com/\" class=\"external close-popup\">FFra</a> for supplying amazing icons packs such as Novus, Flatest, Maximal and to <a href=\"http://dtafalonso.deviantart.com/\" class=\"external close-popup\">Dtafalonso</a> for creating awesome packs such as iOS 7 Alternative, iOS 7 Icons (#1-7)</p>","<p>iChanger is built upon a modified version of <a href=\"http://www.idangero.us/framework7/\">Framework7</a> and some of <a href=\"http://www.cssflow.com/ui-kits/clarity-ios7\">Clarity UI</a>.</p>","<p>Follow us on Twitter <a href=\"https://twitter.com/TheLockenLLC\" class=\"external close-popup\">@TheLockenLLC</a> and <a href=\"http://ichangerteam.deviantart.com/\" class=\"external close-popup\">@iChangerTeam</a> on DeviantArt.</p>","<p>Credits to <a href=\"http://icons8.com/\" class=\"external close-popup\">Icons8</a> for providing some icons throughout the app.</p>"]},{"action":"removeText","range":{"start":{"row":310,"column":3},"end":{"row":310,"column":78}},"text":"iChanger is an iOS app that allows you to theme icons the way you want.</p>"},{"action":"removeText","range":{"start":{"row":310,"column":3},"end":{"row":311,"column":0}},"text":"\n"},{"action":"insertText","range":{"start":{"row":310,"column":3},"end":{"row":310,"column":157}},"text":"TheLocken respects your privacy and does not distribute, make available, or claim any ownership or copyright to the images that you upload to the service."},{"action":"insertText","range":{"start":{"row":310,"column":157},"end":{"row":311,"column":0}},"text":"\n"},{"action":"insertLines","range":{"start":{"row":311,"column":0},"end":{"row":314,"column":0}},"lines":["","The images that are uploaded are stored on our server for a short period of time. They are not displayed to anyone unless you share the URL of the result page. Images may be deleted from our servers at any time without notice.",""]},{"action":"insertText","range":{"start":{"row":314,"column":0},"end":{"row":314,"column":595}},"text":"In no event and under no legal theory, whether in tort (including negligence), contract, or otherwise, unless required by applicable law (such as deliberate and grossly negligent acts) or agreed to in writing, shall TheLocken LLC be liable to users of this service for damages, including any direct, indirect, special, incidental, or consequential damages of any character arising as a result of the use or inability to use the service (including but not limited to damages for loss of goodwill, work stoppage, computer failure or malfunction, or any and all other commercial damages or losses)."}]}],[{"group":"doc","deltas":[{"action":"insertText","range":{"start":{"row"